B.Hi=new A.b4([B.F,"// \u041e\u043f\u0438\u0441\u0430\u043d\u0438\u0435 \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u0438:\n\n\u0424\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u044f \u0441\u0433\u0440\u0443\u0434\u0438\u0432\u0448\u0438\u0445\u0441\u044f \u0443\u0447\u0430\u0441\u0442\u043d\u0438\u043a\u043e\u0432 \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u0438 \u0432\u043e\u043a\u0440\u0443\u0433 \u043e\u0442\u043a\u0440\u044b\u0442\u043e\u0433\u043e \u043a\u0430\u043f\u043e\u0442\u0430 \u043e\u0434\u043d\u043e\u0433\u043e \u0438\u0437 \xab\u0421\u0442\u0443\u0434\u0435\u0431\u0435\u043a\u043a\u0435\u0440\u043e\u0432\xbb. \u0427\u0443\u0442\u044c \u043f\u0440\u0430\u0432\u0435\u0435 \u043e\u0434\u0438\u043d \u0438\u0437 \u0433\u0440\u0443\u043f\u043f\u044b (\u043f\u0440\u043e\u0444\u0435\u0441\u0441\u043e\u0440 \u041a\u0432\u0430\u0447?) \u043e\u0431\u0449\u0430\u0435\u0442\u0441\u044f \u0441 \u0434\u0432\u0443\u043c\u044f \u043c\u0435\u0441\u0442\u043d\u044b\u043c\u0438, \u043d\u0435\u0432\u044b\u0441\u043e\u043a\u0438\u043c\u0438, \u0432 \u0445\u0430\u043b\u0430\u0442\u0430\u0445 \u0438 \u0442\u044e\u0431\u0435\u0442\u0435\u0439\u043a\u0430\u0445. \u041d\u0430 \u0444\u043e\u043d\u0435 \u0432\u044b\u0441\u0442\u0440\u043e\u0438\u043b\u0438\u0441\u044c \u0432 \u0440\u044f\u0434 \u0440\u0430\u0437\u043d\u043e\u043c\u0430\u0441\u0442\u043d\u044b\u0435 \u0433\u043b\u0438\u043d\u043e\u0431\u0438\u0442\u043d\u044b\u0435 \u0434\u043e\u043c\u0438\u043a\u0438. \u0412 \u0443\u0433\u043b\u0443 \u0442\u0435\u043c\u0438 \u0436\u0435 \u0447\u0435\u0440\u043d\u0438\u043b\u0430\u043c\u0438 \u0438 \u0442\u0435\u043c \u0436\u0435 \u043f\u043e\u0447\u0435\u0440\u043a\u043e\u043c: \xab\u041a\u0430\u0448\u0433\u0430\u0440\xbb.\n\n\n// \u0410\u043d\u043d\u043e\u0442\u0430\u0446\u0438\u044f \u043a \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u0438:\n\n\u041d\u0435\u0442 \u043d\u0438\u043a\u0430\u043a\u0438\u0445 \u0444\u043e\u0442\u043e\u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u043e\u0432 \u0441 \u0434\u043b\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u0443\u0447\u0430\u0441\u0442\u043a\u0430 \u043f\u0443\u0442\u0438 \u043c\u0435\u0436\u0434\u0443 \u0421\u0430\u043c\u0430\u0440\u043a\u0430\u043d\u0434\u043e\u043c \u0438 \u041a\u0430\u0448\u0433\u0430\u0440\u043e\u043c. \u041f\u0440\u0438\u0447\u0438\u043d\u0430, \u0441\u043a\u043e\u0440\u0435\u0435 \u0432\u0441\u0435\u0433\u043e, \u0431\u044b\u043b\u0430 \u043e\u0437\u0432\u0443\u0447\u0435\u043d\u0430 \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u043e\u0440\u043e\u043c \u041a\u0432\u0430\u0447\u0435\u043c \u0432 \u0442\u0435\u043b\u0435\u0433\u0440\u0430\u043c\u043c\u0435, \u043e\u0442\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u043e\u0439 \u0438\u0437 \u0433\u043e\u0440\u043e\u0434\u0430 \u041e\u0448 \u2013 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0435\u043c \u043f\u0443\u043d\u043a\u0442\u0435 \u0441 \u0442\u0435\u043b\u0435\u0433\u0440\u0430\u0444\u043e\u043c. \u0412 \u043d\u0435\u0439 \u0443\u043f\u043e\u043c\u0438\u043d\u0430\u0435\u0442\u0441\u044f, \u0447\u0442\u043e \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444 \u043e\u0442\u0440\u044f\u0434\u0430, \u041f\u0430\u0432\u0435\u043b \u0412\u043e\u0440\u043e\u0431\u044c\u0451\u0432, \u0431\u043e\u043b\u0435\u043d, \u043d\u043e \u0431\u0435\u0437 \u043f\u043e\u0434\u0440\u043e\u0431\u043d\u043e\u0441\u0442\u0435\u0439. \u041a\u0440\u043e\u043c\u0435 \u0442\u043e\u0433\u043e, \u041a\u0432\u0430\u0447 \u0441\u0435\u0442\u043e\u0432\u0430\u043b, \u0447\u0442\u043e \u0442\u0435\u0445\u043d\u0438\u043a\u0430 \u043d\u0430\u0447\u0438\u043d\u0430\u0435\u0442 \u0441\u0434\u0430\u0432\u0430\u0442\u044c, \u0430 \u0432\u043f\u0435\u0440\u0435\u0434\u0438 \u0435\u0449\u0451 \u043f\u0443\u0442\u044c \u0447\u0435\u0440\u0435\u0437 \u041f\u0430\u043c\u0438\u0440 \u0438 \u0433\u043e\u0440\u043d\u044b\u0435 \u043f\u0435\u0440\u0435\u0432\u0430\u043b\u044b.\n\n\u0412\u043f\u0440\u043e\u0447\u0435\u043c, \u0434\u043e \u041a\u0430\u0448\u0433\u0430\u0440\u0430 \u0433\u0440\u0443\u043f\u043f\u0430 \u0434\u043e\u0431\u0440\u0430\u043b\u0430\u0441\u044c \u0438 \u0433\u043e\u0442\u043e\u0432\u0438\u043b\u0430\u0441\u044c \u043a \u043f\u043e\u0445\u043e\u0434\u0443 \u0432 \u043f\u0443\u0441\u0442\u044b\u043d\u044e.",B.G,"// Photograph Description:\n\nA photo of the expedition members huddled around the open hood of one of the Studebaker trucks. To the right, one of the group (Professor Kvach?) is chatting with two locals, short, in robes and skullcaps. In the background are rows of differently-built mud houses. In the corner, in the same ink and handwriting: \u201cKashgar\u201d.\n\n\n// Photograph Annotation:\n\nThere are no pictures from the long stretch of road between Samarkand and Kashgar. The reason was most likely voiced by Professor Kvach in a telegram sent from Osh, the last point with the telegraph. It mentions that the photographer of the group, Pavel Vorobyov, is ill, but without details. In addition, Kvach lamented that the equipment was beginning to give up and that the road across the Pamirs was still ahead.\n\nNevertheless, the group had reached Kashgar and was getting ready for the trek into the desert."],t.j)
B.Hj=new A.b4([B.F,u.G,B.G,"When the great and horrible war ended, the victors\u2014to their own surprise\u2014found themselves in possession of a great deal of mysterious and inexplicable evidences acquired by the Third Reich during the short-lived activity of the occult society Ahnenerbe. Those evidences covered a variety of different fields, from biology to astronomy, but the most abundant were, of course, archaeological finds.\n\nHowever, the country with the incredible effort was restoring what was destroyed by the war and the national economy was not up to archaeology. Nevertheless, the People\u2019s Commissariat of Education considered some of the material so important that it organized a full expedition of professors and students of the Historical Faculty of Moscow State University to a remote and uninhabited corner of China\u2014the Taklamakan Desert.\n\nThe available data is insufficient to understand what prompted the cabinet chiefs to make such expenditures and what the results of the event were. However, the \u201cAppendix F\u201d documents are enough to assign the lost \u201cExpedition to Taklamakan\u201d catalogue a MARTYR class of danger and to take appropriate measures for its non-proliferation.\n\nM.A. Yagoda\n11 December 1999."],t.j)
